import { MyToDoItem } from "../types";

const myToDoListMock : MyToDoItem[] = [
    {
        userListNumber: 1,
        userListContent: "안녕하세요",
        userListCheck: true,
    },
    {
        userListNumber: 2,
        userListContent: "안녕하세요2",
        userListCheck: false,
    },
    {
        userListNumber: 3,
        userListContent: "안녕하세요3",
        userListCheck: true,
    },
    {
        userListNumber: 3,
        userListContent: "안녕하세요3",
        userListCheck: true,
    },
];

export default myToDoListMock;
